  false,\n\t\"url\": null,\n\t\"notes\": \"The Geographical Information Center (GIC)
  at California State University, Chico, completed a vegetation map of the Proposed
  Tehachapi Pass High-Speed Rail Corridor (HSRC), covering 199,493 acres. The project
  was funded by the Strategic Growth Council to support routing and mitigation planning
  for the high-speed rail system. The map was produced using heads-up digitizing based
  on 2012 National Agricultural Imagery Program (NAIP) imagery. The minimum mapping
  unit (MMU) is one acre for most vegetation types, with a smaller MMU for wetlands.
  Although the primary purpose of the map is to document vegetation communities, it
  provides additional structural data such as herbaceous, shrub, and tree cover, and
  information about the level of disturbance within the vegetation stand. The overall
  accuracy of the map exceeded the state standard of 80%.\",\n\t\"license_title\":
